“Guess who’s back?! After taking a 3.5-year “break” from speaking in person, I’ve focused on building, learning, and designing the next chapter of my journey. This month, I visited The American School of Paris and The Hague. Why now? It’s because 60% of college graduates can’t find full-time jobs in their fields. For Gen Z, having flexibility in career paths is crucial. They are expected to hold an average of 18 jobs across six different careers and live in 15 homes throughout their lifetimes. They might change jobs as many as 10 times between the ages of 18 and 34. This is why I’ve created a workshop designed to help navigate the often terrifying question of “what’s next?” It guides young people to identify their strengths, determine their values, and learn how to create a path that’s authentic to them. If you’re interested in bringing this workshop to your community, you know what to do: give me a call!” ☎️ 👈 

#DesignYourFuture 
